                    <li>
                        <Image srcGambar='https://s3-ap-southeast-1.amazonaws.com/niomic/img/sample/sate.png'   /> </li> 
                        <li>
                        <Image srcGambar='https://s3-ap-southeast-1.amazonaws.com/niomic/img/sample/sotolamongan.png'  /> </li>   
                </ol>
            </div>
        );
    }
} export default List;
